import React, { useState } from "react";
import "./Main.css";
import { Link } from "react-router-dom";
import CategoriesData from "../datas/CategoriesData";
import CategoriesWomenData from "../datas/CategoriesWomenData";
import CategoriesLimelight from "../datas/CategoriesLimelight";
import FeedbackData from "../datas/FeedbackData";

export const Main = () => {
  const [currentSlide, setCurrentSlide] = useState(0);
  const totalSlides = 8; // Number of images

  const handleClickLeft = () => {
    setCurrentSlide((prevSlide) => (prevSlide === 0 ? totalSlides - 1 : prevSlide - 1));
  };

  const handleClickRight = () => {
    setCurrentSlide((prevSlide) => (prevSlide === totalSlides - 1 ? 0 : prevSlide + 1));
  };

  return (
    <>
      {/* Spotlight Section */}
      <div className="spotlight">
        <div className="container">
          <div className="left">
            <h1>T-Shirt / Tops</h1>
            <h2>Summer <br /> Value Pack</h2>
            <p>cool / colorful / comfy</p>
            <button className="btn">Shop Now</button>
            <img src="assets/carousel-indicators.png" alt="carousel" />
          </div>
        </div>
      </div>

      {/* Explore Section */}
      <div className="explore wrapper">
        <div className="container">
          <ul>
            <li>
              <h1>Low Price</h1>
              <h2>High Coziness</h2>
              <p>UPTO 50% OFF</p>
              <Link to="/explore">Explore Items</Link>
            </li>
            <li className="Beyoung">
              <h1>Beyoung Presents</h1>
              <h2>Breezy Summer <br /> Style</h2>
              <p>UPTO 50% OFF</p>
              <Link to="/explore">Explore Items</Link>
            </li>
          </ul>
        </div>
      </div>

      {/* New Arrival Section */}
      <div className="new-arrival wrapper">
        <div className="top">
          <img src="assets/Rectangle 21.png" alt="new arrival" />
          <h1>New Arrival</h1>
        </div>

        <button className="slide-btn left-btn" onClick={handleClickLeft}>
          <img src="assets/arrow-left.svg" alt="left arrow" />
        </button>

        <div className="bottom">
          <div className="container">
            <ul className="image-list" style={{ transform: `translateX(-${currentSlide * (100 / totalSlides)}%)` }}>
              {[ 
                { src: "assets/img-1.png", alt: "Knitted Joggers", text: "Knitted Joggers" },
                { src: "assets/img-3.jpg", alt: "Full Sleeve", text: "Full Sleeve" },
                { src: "assets/img-4.jpg", alt: "Active T-Shirts", text: "Active T-Shirts" },
                { src: "assets/img-2.jpg", alt: "Urban Shirts", text: "Urban Shirts" },
                { src: "assets/img-5.jpg", alt: "Summer Collection", text: "Summer Collection" },
                { src: "assets/img-6.jpg", alt: "Denim Jackets", text: "Denim Jackets" },
                { src: "assets/img-7.jpg", alt: "Casual Wear", text: "Casual Wear" },
                { src: "assets/img-8.jpg", alt: "Formal Suits", text: "Formal Suits" }
              ].map((item, index) => (
                <li key={index} className="image-item">
                  <img src={item.src} alt={item.alt} />
                  <p>{item.text}</p>
                </li>
              ))}
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};

export default Main;
